import React from "react";
import "./App.css";
import ExpenseItem from "./Components/ExpenseItem";

const App = () => {
  const expense = [
    {
      text: "Do All Exercises!",
      id: "G1",
    },
    {
      text: "Finish The Course!",
      id: "G2",
    },
  ];

  return (
    <div>
      <ExpenseItem text={expense[0].text} />
      <ExpenseItem text={expense[1].text} />
    </div>
  );
};

export default App;
